function insestado(){
  var txt = '<option value="" >Selecione o Estado</option>';
  var esta = "";
  for(var est in cidadesjs){
    if(esta != cidadesjs[est].uf_id) {
      txt += '<option value="' + cidadesjs[est].uf_id + '" >' + cidadesjs[est].uf + '</option>';
      esta = cidadesjs[est].uf_id;
    }
  }
  document.getElementById("selecest").innerHTML = txt;
}

function inscidades(){
  var est = document.getElementById('selecest').value;
  var txt = "";
  for(var cid in cidadesjs){
    if(cidadesjs[cid].uf_id == est) {
      txt += '<option value="' + cid + '" >' + cidadesjs[cid].municipio + '</option>';
    }
  }
  document.getElementById("seleccid").innerHTML = txt;
}
